    first: $first,
    after: $after,
    filter: $filter,
    orderBy: $orderBy
  ) {
    edges {
      node {
        id,
        name,
        description,
        type,
        status,
        dueDate,
        startDate,
        completedDate,
        dueDate,
        assignee{
            id
        },
        priority,
        customer{
            id
        },
        account{
            id
        }
    addresses {
            streetAddressLine1,
