  projectManagementProject(id: $id) {
    name,
    status,
    description,
    startDate,
    dueDate,
    account {
        id
    }
    customer{
        id
    }
  }
}

mutation ProjectManagementCreateProject($name: String!, 
    $description: String,
    $startDate: DateTime,
    $dueDate: DateTime!, 
    $status: ProjectManagement_Status,
    $customer: ProjectManagement_CustomerInput,
    $account: ProjectManagement_CompanyInput!,
    $priority: Int,
    $pinned: Boolean,
    $completionRate: Decimal,
    $emailAddress: [Qb_EmailAddressInput],
    $addresses: [Qb_PostalAddressInput]
) {
  projectManagementCreateProject(input:{
    name: $name,
    description: $description,
    startDate : $startDate,
    dueDate : $dueDate,
    status: $status
    customer: $customer, 
    account: $account,
    priority: $priority,
    pinned: $pinned,
    completionRate: $completionRate,
    emailAddress: $emailAddress,
    addresses: $addresses,
  }
    )
    {
           ... on ProjectManagement_Project {
        id,
        name,
        description,
        startDate,
        dueDate,
        status,
        priority,
        customer{
            id
        },
        account{
            id
        },
        priority,
        pinned,
        completionRate,
        emailAddress {
            email,
            name
        }
        addresses {
            streetAddressLine1,
            streetAddressLine2,
            streetAddressLine3
            state,
            postalCode
        }   
      }
        }
    }

